import './App.css'
import Login from './pages/Login'
import { useSelector } from "react-redux"

function App() {

  const authenticated = useSelector(state => state.user.authenticated)

  return (
    <div className="App">
      { authenticated ? <h1 className="Text">Hey, lil mama</h1> : <Login /> } 
    </div>
  );
}

export default App;
